import React from 'react';
import Theme from './components/Theme'
import Navbar from './components/Navbar'
import Container from './components/Container'


function App() {

	return (
	    <Theme>
	    	<Navbar/>
	    	<Container>
	    		<Navbar />
	    	</Container>
	    </Theme>
	);
}

export default App;
